import React, { Component } from 'react'
import ContactList from './component/contactList'
import ContactForm from './component/ContactForm'

class App extends Component {
  constructor(props) {
    super(props)

    this.state = {
      name: '',
      lastName: '',
      age: '',
      phone: '',
      email: '',
      image: '',
      website: '',
      tags: ''
    }
  }

  render() {
    return (
      <div>
        <nav>User Contacts</nav>
        <main>
          <ContactForm />
          <ContactList />
        </main>
      </div>
    )
  }
}

export default App
